import React from "react";

const Projects = ({ data }) => {
  if (data) {
    var techStack = data.forEach(project=>{
      return (
        project.techStackSkills.map(item=>{
          return (
            <p>{item}</p>
          )
        })
      )
    })

    var projects = data.map((project)=>{
      return (
        <section className="project">
          <div className="projectTitle">
            <h1>{project.title}</h1>
            <img src={project.img} alt="project thumbnail"/>
          </div>
          <div className="projectInfo">
              <a href={project.url} target="_blank"><button>Project Link</button></a>
              <a href={project.github} target="_blank"><button>Github Code</button></a>
              <p>Tech Stack/Skills Demonstrated</p>
              {techStack}
          </div>
        </section>
      )
    })
  }

  return (
    <section id="projects">
      {projects}
    </section>
  );
};

export default Projects;
